import Vue from 'vue';
import Router from 'vue-router';
import HelloContainer from "./components/HelloWorld.vue"; //src/router.js配置组件访问路由
//1.引入自定义组件

import HomeContainer from "./components/tabbar/HomeContainer.vue";
import NewsContainer from "./components/news/NewsContainer.vue";
import MemberContainer from "./components/tabbar/MemberContainer.vue";
import ShopContainer from "./components/tabbar/ShopContainer.vue";
import SearchContainer from "./components/tabbar/SearchContainer.vue";
import NewsDetailContainer from "./components/news/NewsDetailContainer.vue";
import GoodList from "./components/goods/GoodList.vue";
import Goodsinfo from "./components/goods/Goodsinfo.vue";
Vue.use(Router); //2.指定该组件的访问路径

export default new Router({
  routes: [{
    path: '/',
    redirect: "/home"
  }, {
    path: '/home',
    component: HomeContainer
  }, {
    path: '/home/newslist',
    component: NewsContainer
  }, {
    path: '/home/goodslist',
    component: GoodList
  }, {
    path: '/home/goodsinfo/:id',
    component: Goodsinfo,
    name: "goodsinfo"
  }, {
    path: '/member',
    component: MemberContainer
  }, {
    path: '/shop',
    component: ShopContainer
  }, {
    path: '/search',
    component: SearchContainer
  }, {
    path: "/newsdetail/:id",
    component: NewsDetailContainer
  }],
  linkActiveClass: "mui-active" //覆盖默认路由高亮类

});
